import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import queryString from "query-string";

const root = ReactDOM.createRoot(document.getElementById('root'));
const parsed = queryString.parse(window.location.search);

const program_no = "trans_inform";
const server = "http://localhost"
const pub_port = "44329"
const cal_port = "44371"
const trans_port = "44349"

parsed.program_no = program_no;

fetch(`${server}:${pub_port}/api/pub/check`, {
    method: "POST",
    headers: {
        'content-type': 'application/json'
    },
    body: JSON.stringify(parsed)
}).then(function (res) {
    return res.json();
}).then(function (data) {
    if (data.Check) {
        root.render(
            <React.StrictMode>
                <App user_id={data.Msg} program_no={program_no} server={server} pub_port={pub_port} cal_port={cal_port} trans_port={trans_port}/>
            </React.StrictMode>
        );
    } else {
        alert(data.Msg)
    }
}).catch(function (Error) {
    console.log(Error)
})
